import React, { useEffect, useState } from "react";

const UseEffects1 = () => {
  const [count, setCount] = useState(0);

  useEffect(() => {
      if(count === 0){
      document.title = "Chats"

      }else{
      document.title = `Chts(${count})`
      }
    console.log("Usseeffecty");
  });
  console.log("outside");
  return (
    <div>
      <h1>{count}</h1>
      <button onClick = {() => {
          setCount(count + 1)
        //   console.log("Clicked..")
      }}>Click me</button>
    </div>
  );
};

export default UseEffects1;
